import React, { Component,useEffect } from 'react';
import './contactcut.css';
import Aos from 'aos';
import Img from './contact1.jpg';
import {Link} from 'react-scroll';

const ContactCut = () => {

    return (
        
    	<div id="contact">
           <div className='par' 
            style={{backgroundImage:'url(' + Img + ')',height:'auto',maxWidth:'100%'}}>
            <div className='ovr'>
            <h4 style={{color:'white',textAlign:'center',marginTop:80}}>
            If you want to talk about any opportunity or just want to say Hi,</h4>
            <br/>
            <h4 style={{color:'white',textAlign:'center'}}>DROP A MESSAGE</h4>
             <Link
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
          ><button className='btnc'>CONTACT ME</button></Link>
            </div>
            </div>
            
        </div>
    );
}

export default ContactCut;
